import './adminPage.scss'
import ModalAddDevice from '../../components/modal/modalAddDevice/modalAddDevice'
export default function AdminPage() {
 
    const [addDeviceModal,setAddDeviceModal]:any = useState(false)

  const handleDevicemodal = () =>{
     setAddDeviceModal(true)
  }
  return (
    <div className='adminPage'>
      <div className='addDevice'>
        <button onClick={handleDevicemodal}>Добавить товар</button>
        {addDeviceModal ? <ModalAddDevice addDeviceModal={addDeviceModal} setAddDeviceModal={setAddDeviceModal}/> : ''}
      </div>
    </div>
  )
}
